import '../App.css'
import React, { useState, useEffect } from "react"
import Table from 'react-bootstrap/Table';


const TerminateActiveSession = () => {

  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);

  const terminateSesssionRequest = {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' }
};

  useEffect(() => {
    setLoading(true);
    fetch("http://localhost:8080/restaurant/api/v1/terminateSession/1/ashutosh.bhardwaj@gmail.com", terminateSesssionRequest)
      .then((response) => response.json())
      .then((json) => setData(json))
      .finally(() => {
        setLoading(false);
      });
  }, []);

  try {
    axios
      .post(
        "http://localhost:8080/restaurant/api/v1/terminateSession/1/ashutosh.bhardwaj@gmail.com"
      )
      .then((response) => {
        setData({
          restaurantName: response.data.sessionId,
          restaurantAddedBy: response.data.sessionRequestedBy,
          message: response.data.message,
        });
        console.log(response);
        console.log(response.data);
        //Adding user to local storage
        localStorage.setItem(
          "sessionId",
          JSON.stringify(response.data.sessionId)
        );
      });
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; //This line of code will redirect you once the submission is succeed
  }

  return (
    <Table striped bordered hover size="sm">
        <thead>
            <tr>
                <th>restaurant Name</th>
                 <th>restaurant Added By</th>
                 <th>session Id</th>
            </tr>
        </thead>

        <tbody>
            {
                 <tr key={data.restaurantName}>
                 <td>{data.restaurantName}</td>
                 <td>{data.restaurantAddedBy}</td>
                 <td>{data.sessionId}</td>
               </tr>
            }
        </tbody>
    </Table>);
}
export default TerminateActiveSession;
